import React from 'react'
import {useIndexedDB} from 'react-indexed-db'

function PanelExample() {
    const db = useIndexedDB('people');
    console.log(db)
    return (
        <div>
            {JSON.stringify(db)}
        </div>
    )
}

export default PanelExample
